import React, { useState, useEffect, useCallback } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Activity, Terminal, Settings, Info, RefreshCw, Zap, Wifi, WifiOff } from 'lucide-react';
import GraphComponent from './GraphComponent';
import './App.css';

const POLL_INTERVAL = 3000;

// Gateway configuration - adjust these to match your OpenClaw setup
const GATEWAY_URL = process.env.REACT_APP_GATEWAY_URL || 'http://127.0.0.1:18789';
const GATEWAY_TOKEN = process.env.REACT_APP_GATEWAY_TOKEN || '';

function App() {
  const [graphData, setGraphData] = useState({ nodes: [], links: [] });
  const [logs, setLogs] = useState([]);
  const [isConnected, setIsConnected] = useState(false);
  const [lastUpdate, setLastUpdate] = useState(new Date());
  const [showPanel, setShowPanel] = useState(true);
  const [activeAgents, setActiveAgents] = useState(0);
  const [activeTools, setActiveTools] = useState(0);
  const [connectionError, setConnectionError] = useState(null);

  // Add log entry helper
  const addLog = useCallback((message, type = 'info') => {
    const newLog = {
      id: Date.now(),
      time: new Date().toLocaleTimeString(),
      message,
      type,
    };
    setLogs(prev => [newLog, ...prev].slice(0, 50));
  }, []);

  // Fetch data from OpenClaw gateway
  const fetchGatewayData = useCallback(async () => {
    try {
      const headers = {
        'Accept': 'application/json',
      };

      if (GATEWAY_TOKEN) {
        headers['Authorization'] = `Bearer ${GATEWAY_TOKEN}`;
      }

      // Try the sessions endpoint
      const response = await fetch(`${GATEWAY_URL}/api/sessions`, {
        method: 'GET',
        headers,
      });

      if (!response.ok) {
        throw new Error(`HTTP ${response.status}: ${response.statusText}`);
      }

      const result = await response.json();

      // Handle different response formats
      const sessions = Array.isArray(result) ? result : (result.sessions || result.data || []);

      // Transform gateway data to graph format
      const nodes = [];
      const links = [];

      // Always add main agent node
      nodes.push({
        id: 'main',
        name: 'Cosmo',
        type: 'main',
        status: 'running',
      });

      let toolCount = 0;
      let runningAgents = 1; // Count main agent

      sessions.forEach((session) => {
        const sessionId = session.sessionKey || session.id || session._id;
        if (!sessionId) return;

        // Check if session is active (has recent messages or explicit active flag)
        const isActive = session.active || 
          session.status === 'active' || 
          (session.lastMessageAt && (Date.now() - new Date(session.lastMessageAt).getTime() < 300000)); // 5 min

        const agentName = session.label || session.agentId || `Session-${sessionId.slice(0, 6)}`;

        // Add sub-agent node
        nodes.push({
          id: sessionId,
          name: agentName,
          type: 'sub-agent',
          status: isActive ? 'running' : 'idle',
        });

        if (isActive) runningAgents++;

        // Link to main
        links.push({
          source: 'main',
          target: sessionId,
          active: isActive,
        });

        // Check for recent tool calls in message history
        if (session.messages && Array.isArray(session.messages)) {
          const recentToolCalls = session.messages
            .filter(m => m.role === 'assistant' && m.tool_calls && m.tool_calls.length > 0)
            .slice(-3); // Last 3 tool calls

          recentToolCalls.forEach((msg, idx) => {
            msg.tool_calls.forEach((tool, toolIdx) => {
              const toolId = `${sessionId}-tool-${tool.id || toolIdx}`;
              const toolName = tool.function?.name || tool.name || 'Tool';

              nodes.push({
                id: toolId,
                name: toolName,
                type: 'tool',
                status: 'running',
              });

              links.push({
                source: sessionId,
                target: toolId,
                active: true,
              });

              toolCount++;
            });
          });
        }
      });

      setGraphData({ nodes, links });
      setActiveAgents(runningAgents);
      setActiveTools(toolCount);
      setIsConnected(true);
      setConnectionError(null);
      setLastUpdate(new Date());

      // Only log on significant changes
      if (nodes.length !== graphData.nodes.length || links.length !== graphData.links.length) {
        addLog(`Synced: ${runningAgents} agents, ${toolCount} tools active`, 'info');
      }

    } catch (error) {
      console.error('Gateway connection failed:', error);
      setIsConnected(false);
      setConnectionError(error.message);

      // Show main agent even when disconnected
      if (graphData.nodes.length === 0) {
        setGraphData({
          nodes: [{ id: 'main', name: 'Cosmo', type: 'main', status: 'idle' }],
          links: []
        });
      }

      addLog(`Connection lost: ${error.message}`, 'error');
    }
  }, [addLog, graphData.nodes.length, graphData.links.length]);

  // Poll gateway
  useEffect(() => {
    fetchGatewayData();
    const interval = setInterval(fetchGatewayData, POLL_INTERVAL);
    return () => clearInterval(interval);
  }, [fetchGatewayData]);

  return (
    <div className="app-container">
      {/* Header */}
      <header className="header">
        <div className="header-left">
          <Zap className="logo-icon" size={24} />
          <h1 className="title">COSMO COMMAND</h1>
          <span className={`status-badge ${isConnected ? 'online' : 'offline'}`}>
            {isConnected ? 'ONLINE' : 'OFFLINE'}
          </span>
        </div>
        <div className="header-right">
          <div className="connection-info" title={connectionError || 'Connected'}>
            {isConnected ? (
              <Wifi size={16} className="connection-icon online" />
            ) : (
              <WifiOff size={16} className="connection-icon offline" />
            )}
          </div>
          <button className="icon-btn" onClick={() => setShowPanel(!showPanel)}>
            <Terminal size={18} />
          </button>
          <button className="icon-btn" onClick={fetchGatewayData} title="Refresh">
            <RefreshCw size={18} />
          </button>
        </div>
      </header>

      {/* Main Content */}
      <div className="main-content">
        {/* Graph Canvas */}
        <div className="graph-container">
          <GraphComponent data={graphData} />

          {/* Overlay Stats */}
          <div className="stats-overlay">
            <div className="stat-item">
              <Activity size={14} className="stat-icon" />
              <span className="stat-label">AGENTS</span>
              <span className="stat-value cyan">{activeAgents}</span>
            </div>
            <div className="stat-item">
              <Settings size={14} className="stat-icon" />
              <span className="stat-label">TOOLS</span>
              <span className="stat-value amber">{activeTools}</span>
            </div>
          </div>

          {/* Connection Error Overlay */}
          {!isConnected && (
            <div className="connection-overlay">
              <div className="connection-message">
                <WifiOff size={32} />
                <h3>Gateway Unreachable</h3>
                <p>Trying to connect to {GATEWAY_URL}</p>
                <p className="error-detail">{connectionError}</p>
                <button className="retry-btn" onClick={fetchGatewayData}>
                  Retry Connection
                </button>
              </div>
            </div>
          )}
        </div>

        {/* Side Panel */}
        <AnimatePresence>
          {showPanel && (
            <motion.div
              initial={{ x: 300, opacity: 0 }}
              animate={{ x: 0, opacity: 1 }}
              exit={{ x: 300, opacity: 0 }}
              transition={{ type: 'spring', damping: 25, stiffness: 200 }}
              className="side-panel"
            >
              <div className="panel-header">
                <Terminal size={16} />
                <span>SYSTEM LOGS</span>
                <span className="panel-time">
                  {lastUpdate.toLocaleTimeString()}
                </span>
              </div>

              <div className="logs-container">
                {logs.length === 0 ? (
                  <div className="empty-logs">
                    <Info size={24} className="empty-icon" />
                    <p>Waiting for agent activity...</p>
                    <p className="gateway-url">{GATEWAY_URL}</p>
                  </div>
                ) : (
                  logs.map(log => (
                    <motion.div
                      key={log.id}
                      initial={{ opacity: 0, y: -10 }}
                      animate={{ opacity: 1, y: 0 }}
                      className="log-entry"
                    >
                      <span className="log-time">{log.time}</span>
                      <span className={`log-type ${log.type}`}>‚óè</span>
                      <span className="log-message">{log.message}</span>
                    </motion.div>
                  ))
                )}
              </div>

              <div className="panel-footer">
                <div className="legend">
                  <div className="legend-item">
                    <span className="legend-dot cyan"></span>
                    <span>Running</span>
                  </div>
                  <div className="legend-item">
                    <span className="legend-dot amber"></span>
                    <span>Idle</span>
                  </div>
                </div>
                <div className="poll-info">
                  Poll: {POLL_INTERVAL/1000}s
                </div>
              </div>
            </motion.div>
          )}
        </AnimatePresence>
      </div>
    </div>
  );
}

export default App;
